import React from "react";

import {
	NavbarContainer,
	NavbarWrap,
	NavbarDireita,
	NavbarEsquerda,
	NavbarIcones,
	NavbarIconeContainer,
	IconeNumero,
} from "./NavbarElementos";

import { NotificationsNone } from "@material-ui/icons";
import LanguageIcon from "@material-ui/icons/Language";
import SettingsIcon from "@material-ui/icons/Settings";

const Navbar = () => {
	return (
		<NavbarContainer>
			<NavbarWrap>
				<NavbarEsquerda>IMPERAtrading</NavbarEsquerda>
				<NavbarDireita>
					<NavbarIcones>
						<NavbarIconeContainer>
							<NotificationsNone />
							<IconeNumero>2</IconeNumero>
						</NavbarIconeContainer>

						<NavbarIconeContainer>
							<LanguageIcon />
							<IconeNumero>2</IconeNumero>
						</NavbarIconeContainer>

						<NavbarIconeContainer>
							<SettingsIcon />
							<IconeNumero>2</IconeNumero>
						</NavbarIconeContainer>
					</NavbarIcones>
				</NavbarDireita>
			</NavbarWrap>
		</NavbarContainer>
	);
};

export default Navbar;
